นชอบการสร้างความทรงจำที่ดีผ่านการเล่นบอร์ดเกม มาเป็นส่วนหนึ่งของประสบการณ์นี้กัน! ,บอร์ดเกมทำให้เราทุกคนใกล้ชิดกันมากขึ้น มาเล่นและสนุกไปพร้อมๆ กัน!'),('3a644c7c-1321-4ff3-bcba-e600fa5366e4','store','Thiranat','Nutcheroen','2002-09-22','Master','$2a$05$DiYwpGj9Bu.UazMkEiMNleUxky3vSqbqjCTFqPQbqFi3a5aQk2ptC','Theeranat7894@gmail.com','0817927751','ชาย','6a0424d2-7d7b-44ba-a58f-f047d60dca48.jpeg','2024-08-23 06:13:55','2024-08-23 08:19:27',NULL),('3c4242bc-8ff5-4624-bd28-aa41d042d2db','user','Worapakorn6','Jarusiriphot6','2003-03-17','WOJA5345378687453453455555','$2a$05$twpy/X1X/67.qBvySY6BVuNxkjS22QAES868r3IoCz4fqx1vI3B2C','Worapakorn53453786874534534555555@gmail.com','0623844415','ชาย','https://dicedreams-images.s3.ap-southeast-2.amazonaws.com/images/875ade95-4163-4c8f-aab2-bc155c6bd376.jpeg','2024-10-08 06:56:30','2024-10-08 06:56:30',NULL),('3cb8cba9-874c-482e-bb5e-c5d523d77b7a','user','Worapakorn4','Jarusiriphot4','2003-03-17','WOJA4','$2a$05$utEVv0.UwHxyf4W7.dclk.xuet/gYs5tBXKg7RErPYkrM40Nza1ce','Worapakorn4@gmail.com','0623844415','male','4500b662-e071-40d8-946b-eb31ed2dcf4f.jpeg','2024-05-01 23:51:51','2024-05-01 23:51:51',NULL),('43847225-684e-4b23-b114-1d2f3b63522b','user','Worapakorn43','Jarusiriphot43','2003-03-17','WOJA43','$2a$05$UjieH6NnFu1TJoitBCq6c.44n.D9BpkPd5kihgiGQhnjUi1.jFsKe','Worapakorn43@gmail.com','0623844415','ชาย','a84f9cd9-3c1d-4cb2-ba88-a188c298d119.jpeg','2024-07-25 10:34:28','2024-07-25 10:34:28',NULL),('43d2d283-2ed8-45be-a03a-ebf70bc73e9e','user','Worapakorn16','Jarusiriphot16','2024-05-02','worapakorn16','$2a$05$uxXWaertuvbSvaPMfjniQOjANcqhJRy.DuoBKb8qyud1N4zW9n2GW','worapakorn16@gmail.com','0623844415','male',NULL,'2024-05-02 08:12:38','2024-05-02 08:12:38',NULL),('48b0a732-b292-4cf8-bdd2-52156f177587','user','Worapakorn2','Jarusiriphot2','2003-03-17','WOJA2','$2a$05$QBaCeUAZSpMIiIUj0d.Vl.Sdo/upREsHQUftbGrhtjWkjkFtvnkju','Worapakorn2@gmail.com','0623844415','ชาย','https://dicedreams-images.s3.ap-southeast-2.amazonaws.com/images/55bd2d